import React from "react";

import { CardContainer, Image } from "./carousel-card.styles";

const CarouselCard = ({ item }) => {
  return (
    <CardContainer className="carousel__card">
      <Image src={item.image} alt="" />
    </CardContainer>
  );
};

export default CarouselCard;
